import classes from '../styles/Modal.module.css';
import React from 'react'
import { Cart } from './Cart'

export const Modal = () => {
    return (
    <>
        <div className={classes.backdrop}>
            <div className={classes.modal}>
            <Cart/>
            </div>
        </div>
    </>
    )
}
